Description:
A parkour level with a lot of obstacles and archers.

Difficulties: 1 bronze, 1 silver, 1 gold, 1 diamond

Tips:
- feel free to walk on top of beams that have saws underneath them - you won't get hit.
- be careful around conv. belts, they get pretty fast in the end.

Also, there's a small secret and it's somehow connected to 4 small red cubes hidden in the arena.

If this is too easy for you, here's a harder version:
https://steamcommunity.com/sharedfiles/filedetails/?id=2320540242

Update 1.1:
- updated the layout;
- added checkpoints (elevators that activate after you pass a certain trigger);
- added twitch spawn points;
- added screenshots;
- added more difficulties;
- added a small secret.
